import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

import Home from './Components/Home/Home';

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" render={() => <Home />} />

        {/* <Redirect to="/" /> */}
      </Routes>
    </Router>
  );
}

export default App;
